#' A sub-class of the class \code{\linkS4class{mtkEvaluator}} used to perform model simulation
#' with the "WWDM" model defined in the "wwdm.R" file.
#' For more details, see the help of the function "wwdm.simule()" defined in the "wwdm.R" file.
#' @title The mtkWWDMEvaluator class
#' @exportClass mtkWWDMEvaluator

setClass("mtkWWDMEvaluator",
		contains=c("mtkEvaluator")
	)

#' The constructor.
#' @param mtkParameters a vector of [\code{\linkS4class{mtkParameter}}] representing the parameters necessary to run the evaluator.
#' @param listParameters a named list defining the parameters necessary to run the evaluator. It gives non object-oriented way to define the parameters.
#' @return an object of class \code{\linkS4class{mtkWWDMEvaluator}}
#' @examples mtkWWDMEvaluator()
#' @export mtkWWDMEvaluator
#' @title The constructor

mtkWWDMEvaluator<- function(mtkParameters=NULL, listParameters=NULL) {
	p<-mtkParameters
		if(!is.null(listParameters))
			p <- make.mtkParameterList(listParameters)
					
	res <- new("mtkWWDMEvaluator",service="WWDM", parameters=p)
		return(res)
		}


#' Performs the simulation  with the model  "WWDM" defined in the "wwdm.R" file. 
#' @title The run method
#' @param this an object of class \code{\linkS4class{mtkWWDMEvaluator}}
#' @param context an object of class \code{\linkS4class{mtkExpWorkflow}}
#' @return invisible()
#' @exportMethod run
	
setMethod(f="run", signature=c(this="mtkWWDMEvaluator",
			context="mtkExpWorkflow"),
		definition=function(this, context){
			if(this@state) return(invisible())
			nameThis<-deparse(substitute(this))
			
			X <- context@processesVector$design@result@main 
			parameters<-getParameters(this)
			##!!
			##!! Pre-processing the input data, the processing of the method to implement follows:
			##!!
	
	
					output<-eval(do.call("wwdm.simule",c(list(X=X), parameters)))

			##!!
			##!!  post-processing the output of the method:
			##!!
	
		this@result <- mtkWWDMEvaluatorResult(main=output$main, information=output$information)
		this@state<-TRUE
			
			assign(nameThis, this, envir=parent.frame())
			return(invisible())
		})
	
