#' Climate series over 14 years, used by the wwdm model
#' @title Climate series over 14 years, used by the wwdm model
#' @docType data
#' @name wwdm.climates
#' @aliases wwdm.climates
#' @format data.frame of N rows (1 per day) and 4 columns (ANNEE, RG, Tmin, Tmax)
#### @export wwdm.climates

NULL # See the data directory

#' The "wwdm" model (winter wheat dry matter) on wheat growth
#'  Winter Wheat Dry Matter Model (wwdm) is a very simple dynamic crop model
#'  with a daily time step. It has been developed at INRA (France) by David
#'  Makowski, Marie-H\'{e}l\`{e}ne Jeuffroy and Martine Gu\'{e}rif.
#' @title The "wwdm" model (winter wheat dry matter) on wheat growth
#' @param param a vector of length 7 or 8 containing the values of seven WWDM
#'       parameters plus, possibly, a number between 1 and 14
#' @param year either NULL or a number between 1 and 14
#' @param climate name of the data.frame containing the climate data needed by
#'        wwdm.model ; defaults to "wwdm.climates"
#' @note The model has two state variables, the leaf area index and the above-ground
#'  winter wheat dry matter. The function output is the daily increase in
#'  winter wheat dry matter given in 'g per m2 per day'.
#'  One run of the function corresponds to one climate year. By default,
#'  the climate data are read in the file "serieclim.dat" which contains
#'  14 climate years, and the year must be specified by a number between
#'  1 and 14. There are two ways to do that: either by the argument "year"
#'  or by the eigth "param" value if "year" is set to "NULL".
#' @return vector of the 223 daily biomass increases calculated by WWDM
#' @references 
#'   Makowski, D., Jeuffroy, M.-H., Gu\'{e}rif, M., 2004. Bayseian methods for
#'    updating crop model predictions, applications for predicting biomass and
#'    grain protein content. In: Bayseian Statistics and Quality Modelling in
#'    the Agro-Food Production Chain (van Boeakel et al. eds), pp. 57-68.
#'    Kluwer, Dordrecht.
#'   Monod, H., Naud, C., Makowski, D., 2006. Uncertainty and sensitivity
#'    analysis for crop models. In: Working with Dynamic Crop Models (Wallach
#'    D., Makowski D. and Jones J. eds), pp. 55-100. Elsevier, Amsterdam.
#' @examples 
#'  data()
#'  wwdm.model()
#'  sum( wwdm.model() )  #biomasse cumulee
#'  wwdm.model( wwdm.factors$nominal, year=5)
#' @export wwdm.model

wwdm.model <-
		function(param=wwdm.factors$nominal, year=NULL, climate=wwdm.climates)
{
	
	if(class(param)=="numeric"){param <- as.data.frame(as.list(param))}
	names(param) = wwdm.factors$name[seq(length(param))]
	
	Eb    <- param$Eb
	Eimax <- param$Eimax
	K     <- param$K
	Lmax  <- param$Lmax
	A     <- param$A
	B     <- param$B
	TI    <- param$TI
	if (is.null(year)){
		if(ncol(param) == 8) year <- param$Clim
		else year <- 3
	}
	#Calcul de PAR et de ST	 a partir des fichiers climatiques
	PAR <- 0.5*0.01*climate$RG[climate$ANNEE==year]
	Tmean <- (climate$Tmin[climate$ANNEE==year]+climate$Tmax[climate$ANNEE==year])/2
	Tmean[Tmean<0] <- 0
	ST <- Tmean
	for (i in (2:length(Tmean)))
	{
		ST[i] <- ST[i-1]+Tmean[i]
	}
	
	#Calcul de LAI
	Tr <- (1/B)*log(1+exp(A*TI))
	LAI <- Lmax*((1/(1+exp(-A*(ST-TI))))-exp(B*(ST-(Tr))))
	LAI[LAI<0] <- 0
	
	#Calcul de la biomasse (g/m2)
	U <- Eb*Eimax*(1-exp(-K*LAI))*PAR
	# BIOMASSE <-sum(U)
	
	return(U)
}

#' Function to perform a series of simulations of the wwdm model.
#'  Winter Wheat Dry Matter Model (wwdm) is a very simple dynamic crop model
#'  with a daily time step. It has been developed at INRA (France) by David
#'  Makowski, Marie-H\'{e}l\`{e}ne Jeuffroy and Martine Gu\'{e}rif.
#' @param X dataframe of 7 or 8 columns containing the values of seven WWDM
#'       parameters plus, possibly, a number between 1 and 14
#' @param  year either NULL or a number between 1 and 14
#' @note 
#'  The model has two state variables, the leaf area index (LAI) and the winter wheat
#'  cumulated aerial biomass. The function wwdm.simule gives only the cumulated aerial
#'  biomass before harvest, in 'g per m2'.
#'  One simulation corresponds to one climate year. It is possible to 
#'  specify different climate years between simulations, by adding a 'year' 
#'  column to 'X', or to use one single climate year by using the 'year' argument.
#' @return 
#'  cumulated aerial biomass until harvest, in 'g per m2'.
#' @references 
#'   Makowski, D., Jeuffroy, M.-H., Gu\'{e}rif, M., 2004. Bayseian methods for
#'    updating crop model predictions, applications for predicting biomass and
#'    grain protein content. In: Bayseian Statistics and Quality Modelling in
#'    the Agro-Food Production Chain (van Boeakel et al. eds), pp. 57-68.
#'    Kluwer, Dordrecht.
#'   Monod, H., Naud, C., Makowski, D., 2006. Uncertainty and sensitivity
#'    analysis for crop models. In: Working with Dynamic Crop Models (Wallach
#'    D., Makowski D. and Jones J. eds), pp. 55-100. Elsevier, Amsterdam.
#' @examples 
#'  jeux.parametres <- as.data.frame(rbind(wwdm.factors$binf,wwdm.factors$nominal, wwdm.factors$bsup))
#'  names(jeux.parametres) <- wwdm.factors$name
#'  wwdm.simule(jeux.parametres)
#' @export wwdm.simule

wwdm.simule <-
		function(X, year=NULL,...){
	if(is.null(year))
		Biomass = apply(X,1,function(v) sum(wwdm.model(v[1:7],v[8])))
	else
		Biomass = apply(X,1,function(v) sum(wwdm.model(v[1:7],year=year)))
	
	resultat <- list(main=as.data.frame(Biomass), information=NULL)
	return(resultat)
}
